selector_to_html = {"a[href=\"Staff/managing-staff-accounts.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Staff<a class=\"headerlink\" href=\"#staff\" title=\"Link to this heading\">#</a></h1><p>You can find the <strong>Manage Staff</strong> section along the left-hand side of the page:</p>", "a[href=\"#id1\"]": "<figure class=\"align-center\" id=\"id1\">\n<a class=\"reference internal image-reference\" href=\"../_images/PrimarySidebar-Collapsed.webp\"><img alt=\"../_images/PrimarySidebar-Collapsed.webp\" loading=\"lazy\" src=\"../_images/PrimarySidebar-Collapsed.webp\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Collapsed Primary Sidebar</span><a class=\"headerlink\" href=\"#id1\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"Users/managing-user-accounts.html#user-details-accounts-tab\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">User Details - Accounts Tab<a class=\"headerlink\" href=\"#user-details-accounts-tab\" title=\"Link to this heading\">#</a></h2><p>The <strong>User Details</strong> screen also has an <strong>Accounts</strong> tab that allows you to view the accounts associated with the user.</p>", "a[href=\"#user\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">User<a class=\"headerlink\" href=\"#user\" title=\"Link to this heading\">#</a></h1><p>The <strong>User</strong> section allows you to do the following for both <strong>Staff</strong> and <strong>User</strong> accounts:</p>", "a[href=\"#navigating-to-each-section\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Navigating to Each Section<a class=\"headerlink\" href=\"#navigating-to-each-section\" title=\"Link to this heading\">#</a></h2><p>You can find both the <strong>User</strong> and <strong>Staff</strong> section along the left-hand side of the page:</p>", "a[href=\"#id2\"]": "<figure class=\"align-center\" id=\"id2\">\n<a class=\"reference internal image-reference\" href=\"../_images/PrimarySidebar-toggle.webp\"><img alt=\"../_images/PrimarySidebar-toggle.webp\" loading=\"lazy\" src=\"../_images/PrimarySidebar-toggle.webp\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Toggle Primary Sidebar button.</span><a class=\"headerlink\" href=\"#id2\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#id3\"]": "<figure class=\"align-center\" id=\"id3\">\n<a class=\"reference internal image-reference\" href=\"../_images/PrimarySidebar-Open.webp\"><img alt=\"../_images/PrimarySidebar-Open.webp\" loading=\"lazy\" src=\"../_images/PrimarySidebar-Open.webp\" style=\"width: 300px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-text\">Sidebar Expanded</span><a class=\"headerlink\" href=\"#id3\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"Users/managing-user-accounts.html#navigating-the-user-table\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Navigating the User Table<a class=\"headerlink\" href=\"#navigating-the-user-table\" title=\"Link to this heading\">#</a></h2><p>The homepage displays a table of users with the following columns:</p>", "a[href=\"Users/managing-user-accounts.html#view-user-details\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">View User Details<a class=\"headerlink\" href=\"#view-user-details\" title=\"Link to this heading\">#</a></h2><p>To view a <strong>User\u2019s</strong> details:</p>", "a[href=\"Users/managing-user-accounts.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Users<a class=\"headerlink\" href=\"#users\" title=\"Link to this heading\">#</a></h1><p>The <strong>User</strong> section allows you to manage and view <strong>User</strong> accounts.</p>", "a[href=\"Users/managing-user-accounts.html#view-sponsorhip-account\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">View Sponsorhip Account<a class=\"headerlink\" href=\"#view-sponsorhip-account\" title=\"Link to this heading\">#</a></h1>", "a[href=\"Users/managing-user-accounts.html#activity-log-section\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Activity Log Section<a class=\"headerlink\" href=\"#activity-log-section\" title=\"Link to this heading\">#</a></h2><p>The <strong>Activity Logs</strong> section contains a list of changes made to the company\u2019s profile.</p><p>Each <strong>Activity Log entry</strong> contains the following:</p>", "a[href=\"Users/managing-user-accounts.html#information-pane\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Information Pane<a class=\"headerlink\" href=\"#information-pane\" title=\"Link to this heading\">#</a></h1><p>The <strong>Information Pane</strong> (Right Column) provides both an <strong>Activity Log</strong> and a <strong>Created &amp; Modified</strong> Section.</p>", "a[href=\"Users/managing-user-accounts.html#created-modified-section\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Created &amp; Modified Section<a class=\"headerlink\" href=\"#created-modified-section\" title=\"Link to this heading\">#</a></h2><p>The <strong>Created &amp; Modified</strong> section contains the following:</p>", "a[href=\"#menu-icon\"]": "<img src='/en/stable-edit/_static/solo_app/Universal/icons/menu-icon.jpeg' alt='Menu Icon' style='width:100%;'>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
